INSERT INTO `beritas` VALUES (280,'Pembukaaan Perdagangan Sesi 2 dan Konferensi Pers dalam rangka HUT ke-47 Pasar Modal','2024-08-12 10:00:00','https://www.idx.co.id//media/0txdoaa5/hutpm.jpg','https://www.idx.co.id/id/berita/berita/0ad6f5ee-a858-ef11-b809-005056aec3a4?id=10845','Pada Senin, 12 Agustus 2024, jam perdagangan sesi 2 PT Bursa Efek Indonesia (BEI) dibuka dalam rangka HUT ke-47 Pasar Modal. Selama 47 tahun,','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:19','2024-08-14 10:04:19'),(281,'Pencatatan Obligasi Berkelanjutan I Kereta Api Indonesia Tahap II Tahun 2024 dan Sukuk Ijarah Berkelanjutan I Kereta Api Indonesia Tahap II Tahun 2024','2024-08-12 02:00:00','https://www.idx.co.id//media/1557/logo-bursa-efek-indonesia-final.jpg','https://www.idx.co.id/id/berita/berita/a5b80680-a558-ef11-b809-005056aec3a4?id=10843','Pada 12 Agustus 2024, Obligasi Berkelanjutan I Kereta Api Indonesia Tahap II Tahun 2024 dan Sukuk Ijarah Berkelanjutan I Kereta Api Indonesia Tahap II Tahun 2024 oleh PT Kereta Api Indonesia (Persero) mulai dicatatkan di Bursa Efek Indonesia (BEI).','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:19','2024-08-14 10:04:19'),(282,'Sosialisasi Pasar Modal sebagai Alternatif Sumber Pendanaan Perusahaan dan UKM Rangkaian Sosialisasi Edukasi Pasar Modal Terpadu (SEPMT) Makassar','2024-08-08 17:00:00','https://www.idx.co.id//media/ysxhihs5/2024089-septm-makassar.jpg','https://www.idx.co.id/id/berita/berita/2c5a2e7f-1a59-ef11-b809-005056aec3a4?id=10847','testing','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:19','2024-08-14 10:04:19'),(283,'Seremoni Pencatatan Perdana Saham PT Esta Indonesia Tbk (NEST) di Bursa Efek Indonesia','2024-08-08 02:00:00','https://www.idx.co.id//media/ko4ft3ey/20240808_nest.jpg','https://www.idx.co.id/id/berita/berita/ffb5e504-4c55-ef11-b809-005056a