bu, 7 Agustus 2024, pembukaan perdagangan Bursa Efek Indonesia (BEI) dilakukan oleh PT Global Sukses Digital Tbk  (DOSS) dalam rangka pencatatan perdana saham di Papan Pengembangan BEI. DOSS menjadi perusahaan ke-33 yang tercatat di BEI pada tahun 2024.','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:20','2024-08-14 10:04:20'),(287,'Go Public Seminar “Go Big with Go Public”  Bekerja sama dengan KADIN Kota Dumai','2024-08-05 17:02:00','https://www.idx.co.id//media/a23jiamg/2024086-go-public-seminar-dumai.jpg','https://www.idx.co.id/id/berita/berita/17c0c9ba-8058-ef11-b809-005056aec3a4?id=10841','Testing','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:20','2024-08-14 10:04:20'),(288,'Capital Market Community Gathering 2024','2024-07-25 05:00:00','https://www.idx.co.id//media/utooayxf/community-gathering.jpg','https://www.idx.co.id/id/berita/berita/8209bea5-764d-ef11-b809-005056aec3a4?id=10825','Dalam rangka menjaga silaturahmi dan mempererat hubungan dengan komunitas yang aktif melakukan edukasi dan penyebaran informasi terkait investasi di pasar modal melalui media sosialnya, serta memberikan update terkini mengenai perkembangan PT Bursa Efek Indonesia (BEI) dan pasar modal Indonesia sekaligus melakuan sosialisasi #AkuInvestorSaham dan IDX Mobile kepada perwakilan komunitas, BEI menyelenggarakan acara Capital Market Community Gathering 2024.','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:20','2024-08-14 10:04:20'),(289,'Go Public Seminar dan Coaching Clinic bersama Profesi Penunjang Pasar Modal di Surabaya','2024-07-24 05:00:00','https://www.idx.co.id//media/voidnl5s/go-public-seminar-surabaya.jpg','https://www.idx.co.id/id/berita/berita/5df899e0-294e-ef11-b809-005056aec3a4?id=10827','Kota Surabaya menjadi tuan rumah penyelenggaraan Go Public Seminar dan Coaching Clinic pada hari Rabu, 24 Juli 2024. Bertempat di Ballroom Vasa Hotel Surabaya, acara ini dihadiri oleh 63 peserta seminar dan 10 perusahaan peserta coaching clinic. Peserta yang terdiri dari para pengusaha Surabaya, sangat antusias mendengar langsung dari narasumber profesional pasar modal terkait IPO. Kegiatan ini bertujuan untuk meningkatkan literasi dan inklusi pasar modal Indonesia, khususnya mengenai manfaat IPO sebagai alternatif sumber pendanaan yang potensial, serta sebagai house of growth yang terpercaya.','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:20','2024-08-14 10:04:20'),(290,'Imbauan untuk Tidak Memberikan Gratifikasi kepada Insan BEI','2024-07-24 05:00:00','https://www.idx.co.id//media/1557/logo-bursa-efek-indonesia-final.jpg','https://www.idx.co.id/id/berita/berita/69a8da90-9c49-ef11-b809-005056aec3a4?id=10820','Sebagai wujud komitmen PT Bursa Efek Indonesia (BEI) dalam menjaga integritas, independensi, penerapan prinsip-pinsip tata kelola perusahaan yang baik (Good Corporate Governance) serta implementasi Sistem Manajemen Anti Penyuapan (SMAP) ISO 37001:2016','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:20','2024-08-14 10:04:20'),(291,'Coaching Clinic KreatIPO Kota Bandung','2024-07-23 17:00:00','https://www.idx.co.id//media/s03nomvt/20240724-coaching-clinic-kota-bandung.jpg','https://www.idx.co.id/id/berita/berita/19f23eee-8b55-ef11-b809-005056aec3a4?id=10839','Testing','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:20','2024-08-14 10:04:20'),(292,'Katadata Green dan BEI Dorong Penguatan ESG di Indonesia Melalui Acara Road to SAFE 2024','2024-07-22 05:00:00','https://www.idx.co.id//media/brzhexw5/katadata.jpg','https://www.idx.co.id/id/berita/berita/e5df7c53-2f4a-ef11-b809-005056aec3a4?id=10821','Bursa Efek Indonesia (BEI/IDX) dan Otoritas Jasa Keuangan (OJK) mendorong penguatan prinsip environmental, social, and governance (ESG) di sektor bisnis Indonesia, khususnya di pasar modal.','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:20','2024-08-14 10:04:20'),(293,'Tunjuk 23 Bank Administrator RDN dan Bank Pembayaran,  KSEI Tingkatkan Kemudahan Akses Investor ke Pasar Modal','2024-07-19 05:00:00','https://www.idx.co.id//media/rktno5ns/ksei-rdn-bank.jpg','https://www.idx.co.id/id/berita/berita/6dd5865a-304a-ef11-b809-005056aec3a4?id=10823','PT Kustodian Sentral Efek Indonesia (KSEI) melakukan pembaruan kerja sama Bank Administrator Rekening Dana Nasabah (Bank Administrator RDN) dan Bank Pembayaran, yang ditandai dengan penandatanganan Perjanjian Kerja Sama (PKS) pada Jumat (19/7). Kerja sama dengan Bank Administrator RDN dan Bank Pembayaran merupakan salah satu upaya KSEI dalam meningkatkan kemudahan akses investor untuk investasi pasar modal.','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:21','2024-08-14 10:04:21'),(294,'Seremoni Pencatatan Perdana Waran Terstruktur Seri Perdana PT KGI Sekuritas Indonesia (HD)','2024-07-19 02:00:00','https://www.idx.co.id//media/cpohve1o/wt-kgi.jpg','https://www.idx.co.id/id/berita/berita/6c293de9-a345-ef11-b809-005056aec3a4?id=10812','Pada Jumat, 19 Juli 2024, jam perdagangan PT Bursa Efek Indonesia (BEI) dibuka oleh PT KGI Sekuritas Indonesia (HD) dalam rangka pencatatan perdana Waran Terstruktur Seri Perdana PT KGI Sekuritas Indonesia (HD) di BEI.','idx.co.id','https://res.cloudinary.com/dotz74j1p/image/upload/v1715660683/no-image.jpg','2024-08-14 10:04:21','2024-08-14 10:04:21'),(295,'Seremoni Pencatatan Reksa Dana Indeks Mandiri ETF SRI- KEHATI (XMSK) di Bursa Efek Indonesia','2024-07-18 02:00:00','https://www.idx.co.id//media/sxab41k4/xmsk.jpg','https://www.idx.co.id/id/berita/berita/541b50ed-7245-ef11-b809-005056aec3a4?id=10810','Pada Jumat, 19 Juli 2024, jam perdagangan PT Bursa Efek Indonesia 